import { getTimeDate } from "@/utils/index.js";
import RechargeDeatil from "./rechargeDeatilinfo";
import Qs from "qs"; // 1，未完善资料，2、已提交资料，待平台审核，3、审核中，4、审核通过，5、审核失败，6、正常，7、锁定，8，黑名单

export default {
  components: {
    RechargeDeatil: RechargeDeatil
  },
  filters: {
    statusFilter: function statusFilter(status) {
      var statusMap = {
        1: "info",
        2: "success",
        3: "danger"
      };
      return statusMap[status];
    }
  },
  data: function data() {
    return {
      selectItem: {},
      dialogTableVisible: false,
      shoptypelist: [],
      list: null,
      listLoading: true,
      form: {
        shopType: "",
        shopAccount: "",
        shopName: "",
        shopUrl: "",
        starttime: "",
        endtime: "",
        _uiName_: "eleme",
        _pagination: "{'pageNumber':1,'pageSize':10}"
      }
    };
  },
  created: function created() {
    var _this = this;

    //获取店铺类型
    this.axios.get(this.urls.shoptypelist).then(function (response) {
      _this.shoptypelist = response.data;
    });
  },
  computed: {},
  mounted: function mounted() {
    this.fetchData();
  },
  methods: {
    formatTime: function formatTime(row, column, cellValue) {
      return getTimeDate(cellValue);
    },
    resetForm: function resetForm(formName) {
      this.$refs[formName].resetFields();
    },
    //获取充值申请列表
    fetchData: function fetchData() {
      var _this2 = this;

      this.listLoading = true;
      this.axios.get(this.urls.rechargelist + "?" + Qs.stringify(this.form)).then(function (response) {
        _this2.list = response.data.list;
        _this2.listLoading = false;
      });
    },
    operationHandle: function operationHandle(index, row, type) {
      var param = {
        type: type,
        fundsNo: row.fundsNo
      };

      switch (type) {
        case 0:
        case 1:
          this.operationRemote(this.urls.rechargesuccess, param); //拒绝 通过

          break;

        case 2:
          //查看详情
          break;

        default:
          break;
      }
    },
    operationRemote: function operationRemote(url, param) {
      var _this3 = this;

      this.$confirm("是否确认操作?", "提示", {
        confirmButtonText: "确定",
        cancelButtonText: "取消",
        type: "warning"
      }).then(function () {
        _this3.axios.post(url + "?" + Qs.stringify(param)).then(function (response) {
          _this3.fetchData();
        });
      });
    },
    lookinfo: function lookinfo(index, row) {
      this.dialogTableVisible = true;
      this.selectItem = row;
    },
    editDialogListener: function editDialogListener(bol) {
      this.dialogTableVisible = bol;
    }
  }
};
